import React from 'react';
import './App.css';

const App = () => {
  const users = [
    { name: 'Robin', nationality: 'German' },
    { name: 'Markus', nationality: 'American' },
  ];
  return (
    <ul>
      {users.map(user => <li>
        <User
          name={user.name}
          nationality={user.nationality}
        />
      </li>)}
    </ul>
  );
};
const User = ({ name, nationality }) =>
  <span>{name} from {nationality}</span>;

export default App;
